import React from 'react';

const ImageWithTextAndRays = () => {
  return (
    <div className="relative w-screen h-[600px] overflow-hidden"> 
      <div className="relative w-full h-full"> 
        <img
          src="./images/img1.png" 
          alt="Organic Food"
          className="w-full h-full object-cover" 
        />

<div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 z-10 text-center">
  {/* Текст "Natural Products" */}
  <p className="flex flex-col justify-center items-center text-white text-[60px] font-extrabold leading-[60px] tracking-[0.5px] font-manrope mb-6">
    Natural Products
  </p>

  {/* Текст "For Lovers of" и "Healthy" на одной линии */}
  <div className="flex justify-center items-center space-x-4">
    <h1 className="text-white text-[60px] font-extrabold leading-[60px] tracking-[0.5px] font-manrope">
      For Lovers of
    </h1>
    <h1 className="text-[#EEC044] text-[60px] font-extrabold leading-[60px] tracking-[0.5px] font-manrope">
      Healthy
    </h1>
  </div>

  {/* Текст "Organic Food" */}
  <p className="flex flex-col justify-center items-center text-white text-[60px] font-extrabold leading-[60px] tracking-[0.5px] font-manrope">
    Organic Food
  </p>
</div>



        {/* Лучи */}
        <div
          className="absolute z-0"
          style={{
            top: '0px',
            left: '120px', // Первый луч смещен вправо
            width: '170px',
            height: '100%',
            transform: 'rotate(15.098deg)',
            opacity: 0.08, // Светлее на 2 тона (увеличиваем opacity)
            background: 'linear-gradient(180deg, #FFF 0%, rgba(255, 255, 255, 0.00) 100%)',
          }}
        ></div>
        <div
          className="absolute z-10"
          style={{
            top: '0px',
            left: '200px', // Второй луч смещен еще правее и наложен на первый
            width: '170px',
            height: '100%',
            transform: 'rotate(15.098deg)',
            opacity: 0.06, // Светлее на 2 тона (увеличиваем opacity)
            background: 'linear-gradient(180deg, #FFF 0%, rgba(255, 255, 255, 0.00) 100%)',
          }}
        ></div>
      </div>
    </div>
  );
};

export default ImageWithTextAndRays;
